"202209":{"id":"202209","name":"Os Últimos Dias da era Espacial","slug":"os-ultimos-dias-da-era-espacial","original_title":"Last Days of the Space Age","overview":"É o fim de uma era, e tudo está prestes a mudar. A história está num momento decisivo, com um concurso de beleza mundial criando frenesi na mídia. Mas isso não é nada comparado ao drama que três famílias aparentemente comuns estão enfrentando, em uma cidade que nunca mais será a mesma.","first_air_date":"2024-10-02","episode_run_time":0,"vote_average":5.8,"number_of_seasons":1,"number_of_episodes":8,"created_by":["David Chidlow"],"production_companies":["Princess Pictures"],"genres":["Comédia","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/7o1fli8apJ2BMNsYpGmkWYsHgSI.jpg","poster_path":"https://image.tmdb.org/t/p/original/pFFhHwNDsyslQV0OZ102rdDRJ9y.jpg","cast":["Radha Mitchell","Jesse Spencer","Deborah Mailman","Iain Glen","Linh-Dan Pham"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/pFFhHwNDsyslQV0OZ102rdDRJ9y.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/pFFhHwNDsyslQV0OZ102rdDRJ9y.jpg","air_date":"2024-10-02","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Só Crianças Sonham Ser Astronautas","overview":"Um incidente perigoso desorienta Judy Bissett e seu marido Tony. Os sonhos de Tilly Bissett de ir para o espaço são frustrados por seu amigo Jono, enquanto Mia Bissett considera uma mudança drástica em sua vida. Eileen lida com seu próprio drama familiar. Enfim, Judy é forçada a fazer uma escolha que pode destruir sua família.","air_date":"2024-10-02","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/yvKAWXMhYYtQrEehJZfmAU6hci2.jpg","vote_average":0},"2":{"name":"Ela é Quem Manda Agora","overview":"A participante soviética do concurso de beleza chega a Perth, onde seu traumático encontro com manifestantes oferece a Mick Bisset uma oportunidade. A promoção de Judy a obriga a tomar uma decisão impossível. O neto de Eileen, Bilya, vem para ficar e cai nas graças de Tilly, enquanto a família de Jono enfrenta uma tragédia.","air_date":"2024-10-02","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/wsccUhMeZHTe1Tm59wEzDLPsFad.jpg","vote_average":0},"3":{"name":"Faremos um Evento","overview":"A festa para comemorar o 150º aniversário de Perth chegou. Judy e Tony lidam com as consequências da demissão, mas será que Tony estará preparado para isso? Mick elabora uma estratégia incomum de relações públicas para Svetlana. Bilya intensifica a tensão e a desavença entre Tilly e Mia chega a um clímax inesperado.","air_date":"2024-10-02","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/t835OWNdt77iTVdTa9SfJziL3rM.jpg","vote_average":0},"4":{"name":"Bons Garotos não Roubam Carros","overview":"O passeio de Mia e Jono tem consequências catastróficas, forçando uma ruptura entre seus pais e ameaçando os planos frágeis de resgate da família Bui. Bob entra em choque no terreno dos Bissett, enquanto Bilya tenta seguir em frente. Enquanto isso, Svetlana faz um pedido irrecusável a Mick.","air_date":"2024-10-02","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/jxQm2dwA7yTJvFTEXVDKMm8HFdS.jpg","vote_average":0},"5":{"name":"A Praia Ainda é Sua","overview":"Mick não deixará que nada atrapalhe seu império em crescimento. Quando Tony aceita uma oferta de emprego de seu irmão, ele se vê arriscando todo o trabalho duro de Judy em um momento de impulsividade. Enquanto isso, Bob tenta convencer Mia a retomar o rumo, e Bilya força Elieen a fazer uma escolha difícil.","air_date":"2024-10-02","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/smpyIVpoE0GevbX9wKQS3smYGxY.jpg","vote_average":0},"6":{"name":"Vejo Você do Outro Lado","overview":"Uma tragédia acontece, deixando a cidade abalada e a família Bissett se esforçando para processar o que aconteceu. Eileen sofre em silêncio, enquanto os fantasmas do passado de Tony o assombram. O segredo de Svetlana cresce, enquanto Mia, Judy e Tony descobrem seus próprios segredos.","air_date":"2024-10-02","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/oL0f1AvwNTk8VnoB1E4ebFFNOfE.jpg","vote_average":0},"7":{"name":"Quer Ouvir ou Não a Minha História?","overview":"A verdade vem à tona em grande estilo quando Judy, Mia e Francesca descobrem um segredo bombástico. Eileen, por sua vez, fala sua verdade, mudando a vida de todos ao seu redor. Tony finalmente enfrenta seus demônios.","air_date":"2024-10-02","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/aqXhMYBKnV4VvlhF7uuxoa6Q1aT.jpg","vote_average":0},"8":{"name":"Nenhum Problema em se Arrumar para o Apocalipse","overview":"Enquanto Judy encara seu algoz, Tony confronta o passado, revelando a Eileen algumas verdades há muito enterradas. A disputa pelo destino da usina chega ao seu auge. E quando o baile de formatura e o concurso de beleza começam, a Skylab se aproxima.","air_date":"2024-10-02","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/c7onmiZiKT3y4oEDuDfIolk65HU.jpg","vote_average":0}}}}},
