"94598":{"id":"94598","name":"A Magia dos Andes","slug":"a-magia-dos-andes","original_title":"Andes mágicos","overview":"Da Argentina à Colômbia, este impressionante documentário conta a história de cinco pessoas e sua profunda conexão com a majestosa cordilheira sul-americana.","first_air_date":"2019-10-15","episode_run_time":25,"vote_average":8.1,"number_of_seasons":2,"number_of_episodes":10,"created_by":["Alexandra Hardorf","Luis Ara"],"production_companies":["ZDF","Trailer Films","dmfilm und tv produktion"],"genres":["Documentário"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/kUUsQZKL1nErsvb28VRDz7YZtbO.jpg","poster_path":"https://image.tmdb.org/t/p/original/8MKasdFAuxjy5PdBJ1xWQE5GqGg.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/mn2C4JZIc9EE2NQvOht4TJ2CTgD.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/mn2C4JZIc9EE2NQvOht4TJ2CTgD.jpg","air_date":"2019-10-15","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Argentina e Chile: geleiras do sul","overview":"Tudo começa na Terra do Fogo, o ponto mais ao sul do planeta Terra, na Argentina, e continua no impressionante parque Torres del Paine, no Chile.","air_date":"2019-10-15","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Chile e Argentina: do Aconcágua ao deserto","overview":"Os Andes se estendem desde Mendoza até o Deserto do Atacama, o lugar que pode ter as respostas para algumas das maiores perguntas sobre a origem da humanidade.","air_date":"2019-10-15","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Bolívia: o portal do Altiplano","overview":"Chegamos à Bolívia, onde fica o Salar de Uyuni, o maior deserto de sal do mundo, e La Paz, que oferece um passeio de teleférico para ver o Altiplano Andino de cima.","air_date":"2019-10-15","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Peru: uma cultura ancestral","overview":"No Peru, as cidades convivem com os símbolos do Império Inca, como Machu Picchu, e mostram uma forte ligação entre a história e a modernidade.","air_date":"2019-10-15","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Peru e Equador: a escalada do vulcão Cotopaxi","overview":"No Equador, aventureiros tentam conquistar o vulcão ativo Cotopaxi e estradas sinuosas ligam a vida nas montanhas às metrópoles locais.","air_date":"2019-10-15","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Colômbia: montanhas e a selva exuberante","overview":"A jornada de 8.500 quilômetros pelos Andes chega ao fim na Colômbia, onde montanhas abrigam cidades agitadas, como Cali, Medellín e Bogotá.","air_date":"2019-10-15","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/eUyxusMNkkt8uFzt4OSpngReHDO.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/eUyxusMNkkt8uFzt4OSpngReHDO.jpg","air_date":"2021-04-01","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Venezuela e Colômbia","overview":"Pai e filho decidiram dominar o imponente Pico Bolívar, na Venezuela. Na Colômbia, um grupo de apicultores trabalha para preservar a flora andina de forma sustentável.","air_date":"2021-04-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Peru e Equador","overview":"Das especialidades culinárias de Cuenca, no Equador, aos pontos de kitesurf de Gallito Ciego, no Peru, a vida nos Andes é tão rica e variada quanto suas paisagens.","air_date":"2021-04-01","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"La Rioja Argentina, um oásis no Peru e Bolívia","overview":"O passeio continua com uma viagem a La Rioja, Argentina. Conheceremos também uma cidade boliviana que parou no tempo e um oásis no deserto peruano.","air_date":"2021-04-01","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Argentina e Chile","overview":"Onde começam e terminam os Andes? Não há uma resposta exata, mas em Punta Arenas, Chile, eles continuam debaixo d'água.","air_date":"2021-04-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
